// import React from 'react'
import React, { useState } from "react";
// import { useDispatch } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import TermsandCondition from "../UserProfile/TermsandCondition";

const Signup = () => {

    const [formData, setFormData] = useState({
        name: "",
        email: "",
        phone_number: "",
      });
      const navigate = useNavigate();
    //   const dispatch = useDispatch();
      const [alertMessage, setAlertMessage] = useState("");
      const [showAlert, setShowAlert] = useState(false);
    
      const handleChange = (e) => {
        const { id, value } = e.target;
        setFormData((prevData) => ({
          ...prevData,
          [id]: value,
        }));
      };
    
      const handleSubmit = async (e) => {
        e.preventDefault();
      
        // Check for empty fields
        if (!formData.name || !formData.email || !formData.phone_number) {
          setAlertMessage("Please fill out all fields.");
          setShowAlert(true);
      
          // Hide alert after 5 seconds
          setTimeout(() => setShowAlert(false), 5000);
          return; // Exit early if fields are empty
        }
    
        formData.email= formData?.email.toLowerCase()
      
        try {
          // Dispatch the createinfluencers action
        //   await dispatch(createinfluencers(formData));
    
          navigate("/signin")
      
          // No need to show component's alert, API will handle notifications
        } catch (error) {
          // Optionally log the error for debugging
          console.error("API Error:", error);
      
          // No need to show error alert, API will handle notifications
        }
      };
  return (
<div className="min-h-screen flex items-center justify-center bg-blue-50 px-4 py-6 relative">
  {/* Alert */}
  {showAlert && (
    <div className="absolute top-5 w-full max-w-sm">
      <div
        className={`${
          alertMessage.includes("successfully")
            ? "bg-green-200 border-green-400 text-green-800"
            : "bg-red-200 border-red-400 text-red-800"
        } border p-4 rounded-lg shadow-lg`}
      >
        <p className="font-semibold">
          {alertMessage.includes("successfully") ? "Success" : "Error"}
        </p>
        <pre className="whitespace-pre-wrap text-sm">{alertMessage}</pre>
      </div>
    </div>
  )}

  <div className="w-full max-w-lg bg-white p-8 rounded-xl shadow-2xl">
    <h2 className="text-3xl font-bold text-blue-600 text-center mb-8">
      Create Your Account
    </h2>
    <form onSubmit={handleSubmit}>
      {/* Name Field */}
      <div className="mb-6">
        <label
          htmlFor="name"
          className="block text-sm font-medium text-gray-700"
        >
          Full Name
        </label>
        <input
          type="text"
          id="name"
          value={formData.name}
          onChange={handleChange}
          className="w-full mt-2 p-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          placeholder="John Doe"
        />
      </div>

      {/* Email Field */}
      <div className="mb-6">
        <label
          htmlFor="email"
          className="block text-sm font-medium text-gray-700"
        >
          Email Address
        </label>
        <input
          type="email"
          id="email"
          value={formData.email}
          onChange={handleChange}
          className="w-full mt-2 p-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          placeholder="example@mail.com"
        />
      </div>

      {/* Phone Number Field */}
      <div className="mb-6">
        <label
          htmlFor="phone_number"
          className="block text-sm font-medium text-gray-700"
        >
          Phone Number
        </label>
        <input
          type="tel"
          id="phone_number"
          value={formData.phone_number}
          onChange={handleChange}
          className="w-full mt-2 p-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          placeholder="+1234567890"
        />
      </div>

      {/* Submit Button */}
      <div className="mt-8">
        <button
          type="submit"
          className="w-full bg-blue-500 text-white py-3 rounded-lg font-semibold text-lg shadow-md hover:bg-blue-600 transition duration-300"
        >
          Sign Up
        </button>
      </div>
    </form>
    {/* Already have an account */}
    <div className="mt-8 text-center">
      <p className="text-sm text-gray-600">
        Already have an account?{" "}
        <Link
          to="/signin"
          className="text-blue-500 font-medium hover:underline"
        >
          Login
        </Link>
      </p>
    </div>
  </div>
</div>


  )
}

export default Signup
